import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Figma Design Preview</h1>
        <iframe
          style={{ border: "1px solid rgba(0, 0, 0, 0.1)" }}
          width="800"
          height="450"
          src="https://embed.figma.com/design/QPebY5x0bK6Y6tyZDX5sT6/Hack-Beanpot?node-id=0-1&embed-host=share"
          allowFullScreen
        ></iframe>
      </header>
    </div>
  );
}

export default App;
